import React, { Component } from 'react'

import {Link} from 'react-router-dom';


const IssueList = ({issues}) => {



  const renderIssues = Object.keys(issues).map(issuesID =>

    <Link key={issuesID} to={`/issues/${issuesID}`}  > <h1>{issues[issuesID].message}</h1> </Link>
    )



    return (
      <div>
        {renderIssues}
      </div>
    )
  }



export default IssueList
